drop table if exists employees_committees;
drop table if exists employees;
drop table if exists pay_details;
drop table if exists teams;
drop table if exists committees;

create table committees (
        id INT PRIMARY KEY,
	name VARCHAR(50)
);

create table teams (
        id INT PRIMARY KEY,
        name VARCHAR(50),
        charge_cost VARCHAR(4)
);

create table pay_details (
	id INT PRIMARY KEY,
	local_account_no VARCHAR(50),
	local_sort_code VARCHAR(50),
	iban VARCHAR(50),
	local_tax_code VARCHAR(50)
);

create table employees (
	id INT PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	ip_address VARCHAR(20),
	mac_address VARCHAR(50),
	department VARCHAR(50),
	team_id INT NOT NULL references teams(id),
	grade INT,
	country VARCHAR(50),
	fte_hours NUMERIC(3,2),
	pension_enrol BOOLEAN,
	salary INT,
	pay_detail_id INT UNIQUE NOT NULL references pay_details(id),
	start_date DATE
);

create table employees_committees (
        id INT PRIMARY KEY,
	employee_id INT NOT NULL REFERENCES employees(id),
	committee_id INT NOT NULL REFERENCES committees(id)
);






